▪︎
I've always found baths very relaxing. When I have a night off (especially when it is cold outside) it is so nice to step into a hot bath. 🧖‍♀️

Here are my favorite 5 ways to make your me-time more relaxing:

1. Do not bring your phone! I know it is tempting to bring your phone to watch netflix or youtube, but you will also see your notifications. (If you are still determined to bring your phone, make sure the notifications are off by using a do-not-interrupt mode.)

2. Use a bath bomb, bath oil or essential oil. Oils will leave your skin super soft and usually smell super nice. Bath bombs are just the most fun and best-smelling thing ever. Especially the ones from @lush

3. Read a book! 📖

4. Try a meditation when you are in the tub. You could do some breathing exercises or a full body check. 🧘

5. Make sure you do some kind of skincare after your bath. Lather on some bodylotion, put on moisturizer or put a leave-in-conditioner in your hair. You will feel more taken care of and your skin will thank you for it! ☺

Let me know your favorite self-care routine! 💫

